class Main extends Component {
    render() {
        return (
            <main id="mainContainer">
                <div className="container">
                    <ProductContainer></ProductContainer>
                    <MessageContainer></MessageContainer>
                    <CartContainer></CartContainer>
                </div>
            </main>
        );
    }
}

export default Main;
